import "./CryptoListItem.css";

export default function CryptoListItem(props) {
  return (
    <div className="crypto-list-item-main">
      <div className="index">{props.index}</div>
      <div className="symbol">{props.symbol} :</div>
      <div className="name">{props.name} </div>
      <div className="price">
        {`$${Math.round((props.price + Number.EPSILON) * 100) / 100}`}
      </div>
      <div className="oneHour">{props.oneHour}</div>
      <div className="twentyfourHour">{props.twentyFourHour}</div>
      <div className="sevenDay">{props.sevenDay}</div>
      <div className="twentyfourVol">{props.twentyFourHourVolume}</div>
      <div className="marketCap">{props.marketCap}</div>
    </div>
  );
}
